import React from "react";
import { Formik, Form, Field } from "formik";
import * as Yup from "yup";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import "./login.css";

const SignupSchema = Yup.object().shape({
  firstname: Yup.string().required("Firstname is required."),
  lastname: Yup.string().required("Lastname is required."),
  username: Yup.string().required("Username is required."),
  email: Yup.string().email("Invalid email address").required("Email is required."),
  dob: Yup.date().required("Date of Birth is required."),
  password: Yup.string().required("Password is required."),
  number: Yup.string().required("Contact Number is required.").min(10,"Invalid Mobile number"),
});

function Signup() {
  const navigate = useNavigate();


  function handleSignup(values, actions) {
    navigate("/");
    // axios.post("/api", values)
    //   .then(response => {
    //     alert("Signup successful!");
    //     navigate("/");
    //   })
      // .catch(error => {
      //   console.error("Error signing up:", error);
      // });
  }

  return (
    <div className="signin">
      <Formik
        initialValues={{
          firstname: "",
          lastname: "",
          username: "",
          email: "",
          dob: "",
          password: "",
          number: "",
        }}
        validationSchema={SignupSchema}
        onSubmit={handleSignup}
      >
        {({
          values,
          errors,
          touched,
          handleChange,
          handleBlur,
          handleSubmit
        }) => (
          <Form action="userCreate"method="POST">
            <img src={require("../assets/Images/logo.png")} alt="Logo" />
            <b>Signup to feel the rental experience</b>

            <Field
              type="text"
              name="firstname"
              placeholder="Firstname"
              value={values.firstname}
              onChange={handleChange}
              onBlur={handleBlur}
            />
            {touched.firstname && errors.firstname && (
              <span className="error">{errors.firstname}</span>
            )}

            <Field
              type="text"
              name="lastname"
              placeholder="Lastname"
              value={values.lastname}
              onChange={handleChange}
              onBlur={handleBlur}
            />
            {touched.lastname && errors.lastname && (
              <span className="error">{errors.lastname}</span>
            )}

            <Field
              type="text"
              name="username"
              placeholder="Username"
              value={values.username}
              onChange={handleChange}
              onBlur={handleBlur}
            />
            {touched.username && errors.username && (
              <span className="error">{errors.username}</span>
            )}

            <Field
              type="email"
              name="email"
              placeholder="Email"
              value={values.email}
              onChange={handleChange}
              onBlur={handleBlur}
            />
            {touched.email && errors.email && (
              <span className="error">{errors.email}</span>
            )}

            <Field
              type="date"
              name="dob"
              placeholder="Date of Birth"
              value={values.dob}
              onChange={handleChange}
              onBlur={handleBlur}
            />
            {touched.dob && errors.dob && (
              <span className="error">{errors.dob}</span>
            )}

            <Field
              type="password"
              name="password"
              placeholder="Password"
              value={values.password}
              onChange={handleChange}
              onBlur={handleBlur}
            />
            {touched.password && errors.password && (
              <span className="error">{errors.password}</span>
            )}

            <Field
              type="number"
              name="number"
              placeholder="Contact Number"
              value={values.number}
              onChange={handleChange}
              onBlur={handleBlur}
            />
            {touched.number && errors.number && (
              <span className="error">{errors.number}</span>
            )}

            <button id="btn1" type="submit">
              SIGN UP
            </button>
            <p>
              Already a user? <a href="/">Sign in</a> instead
            </p>
          </Form>
        )}
      </Formik>
    </div>
  );
}

export default Signup;
